  var assetPieChart = function() {
    
    var svgWidth   = 380,
        svgHeight  = 240,
        width      = svgWidth,
        height     = svgHeight,
        radius     = Math.min(width, height) / 2,
        colorRange = ["#98A9B8", "#7C485A", "#F5A95F", "#E5DAC7", "#434E65"];
  
    var year;
    
    function chart(selection) {
      selection.each(function(data) {
        
        var svg = d3.select(this).selectAll("svg").data([data]);
        
        var gEnter = 
          svg.enter()
          .append("svg")
          .append('g')
          .attr('class', 'acw');
        
        gEnter.append("g")
          .attr("class", "slices");
          
        gEnter.append("g")
          .attr("class", "labels");
          
        gEnter.append("g")
          .attr("class", "lines");
          
        gEnter.append("g")
          .attr("class", "outer-arc")
          .append('circle')
          .attr('cx', 0)
          .attr('cy', 0)
          .attr('r', radius*0.8);
  
        var pie = d3.layout.pie()
          .sort(null)
          .value(function(d) {
            return d.value;
          });
          
        var arc = d3.svg.arc()
          .innerRadius(radius * 0.0)
          .outerRadius(radius * 0.8);
        
        var outerArc = d3.svg.arc()
          .innerRadius(radius * 0.9)
          .outerRadius(radius * 0.9);
        
        gEnter.attr(
          "transform", 
          "translate(" + width / 2 + "," + height / 2 + ")"
        );
        svg.attr("width", width);
        svg.attr("height", height);
        
        var key = function(d){ return d.data.label; };
        
        var color = d3.scale.ordinal()
          .domain(_.map(data, function(d){ return d.label; }))
          .range(colorRange);
        
         function mapData (data){
            var labels = color.domain();
            return labels.map(function(label, i){
              return data[i];
            });
          }
          
        change(mapData(data));
        
        function change(data) {

          /* ------- PIE SLICES -------*/
          var slice = svg.select(".slices")
            .selectAll("path.slice")
            .data(pie(data), key);
          
          slice.enter()
            .insert("path")
            .style("fill", function(d) { 
              return color(d.data.label); 
             })
            .attr("class", "slice");
      
          slice.transition()
            .duration(1000)
            .attrTween("d", function(d) {
              this._current   = this._current || d;
              var interpolate = d3.interpolate(this._current, d);
              this._current   = interpolate(0);
              return function(t) {
                return arc(interpolate(t));
              };
            });
      
          slice.exit().remove();
      
          /* ------- TEXT LABELS -------*/
      
          var text = svg
            .select(".labels")
            .selectAll("text")
            .data(pie(data), key);
      
          text.enter()
            .append("text")
            .attr("dy", ".35em")
            .text(function(d) {
              return d.data.label;
            });
          
          function midAngle(d){
            return d.startAngle + (d.endAngle - d.startAngle)/2;
          }
      
          text.transition().duration(1000)
            .attrTween("transform", function(d) {
              this._current   = this._current || d;
              var interpolate = d3.interpolate(this._current, d);
              this._current   = interpolate(0);
              return function(t) {
                var d2  = interpolate(t);
                var pos = outerArc.centroid(d2);
                pos[0]  = radius * (midAngle(d2) < Math.PI ? 1 : -1);
                return "translate("+ pos +")";
              };
            })
            .styleTween("text-anchor", function(d){
              this._current   = this._current || d;
              var interpolate = d3.interpolate(this._current, d);
              this._current   = interpolate(0);
              return function(t) {
                var d2 = interpolate(t);
                return midAngle(d2) < Math.PI ? "start":"end";
              };
            });
      
          text.exit().remove();
      
          /* ------- SLICE TO TEXT POLYLINES -------*/
      
          var polyline = svg
            .select(".lines")
            .selectAll("polyline")
            .data(pie(data), key);
          
          polyline
            .enter()
            .append("polyline");
      
          polyline
            .transition()
            .duration(1000)
            .attrTween("points", function(d){
              this._current   = this._current || d;
              var interpolate = d3.interpolate(this._current, d);
              this._current   = interpolate(0);
              return function(t) {
                var d2 = interpolate(t),
                   pos = outerArc.centroid(d2);
                pos[0] = radius * 0.95 * (midAngle(d2) < Math.PI ? 1 : -1);
                var innerPos = _.map(arc.centroid(d2), function(a){
                  return a*1.9;
                });
                return [innerPos, outerArc.centroid(d2), pos];
              };
            });
          
          polyline.exit().remove();
      };

      });
    }
    
    chart.reRalcRadius = function(){
      radius = Math.min(width, height) / 2;
      return chart;
    }
    
    chart.width = function(_){
      if (!arguments.length) return width;
      width = _;
      return chart;
    };

    chart.height = function(_){
      if (!arguments.length) return height;
      height = _;
      return chart;
    };
    
    
    chart.setYear = function(_){
      if (!arguments.length) return year;
      year = _;
      return chart;
    };
    
    chart.resetYear = function(){
      year = undefined;
      return chart;
    }
    
    
    return chart;
    
  };
  
